import React from 'react';

function App() {
  return (
    <main>
      <header>
        <a href="" className="logo">My Logo</a>
        <nav>
          <a href="">Login</a>
          <a href="">Register</a>
        </nav>
      </header>
        <div className="post">
          <img src="https://www.happiesthealth.com/wp-content/uploads/2023/05/dill-leaves.jpg"/>
          <h2>Enhancing flavour and health with dill leaves</h2>
          <p>Herbs and spices are like gold dust. Just a sprinkle of them can add multiple benefits to our plate. Not only do they taste and smell good and make our meals flavourful but also provide nutrients. Dill leaves is one such herb that we can add to our food.</p>
        </div>
    </main>
  );
}

export default App;
